import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Profile.css';

function AdminProfile() {
  const navigate = useNavigate();
  const user = JSON.parse(localStorage.getItem('user'));

  const handleLogout = () => {
    localStorage.removeItem('user');
    navigate('/login');
  };

  const handleViewDocuments = () => {
    navigate('/documents');
  };

  return (
    <div className="profile-container">
      <div className="profile-header">
        <h1>Профиль работника ЦДО</h1>
        <button onClick={handleLogout} className="logout-button">Выйти</button>
      </div>
      <div className="profile-content">
        <div className="profile-info">
          <h2>Информация о пользователе</h2>
          <p><strong>Имя:</strong> {user.name}</p>
          <p><strong>Логин:</strong> {user.login}</p>
          <p><strong>Роль:</strong> Работник ЦДО</p>
        </div>
        <div className="profile-actions">
          <h2>Доступные действия</h2>
          <div className="action-buttons">
            <button className="action-button" onClick={handleViewDocuments}>Просмотр документов</button>
            <button className="action-button">Управление пользователями</button>
            <button className="action-button">Просмотр статистики</button>
            <button className="action-button">Настройки системы</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default AdminProfile;
